    def test_WYMeshTestCase_get_mesh_vt_str_TC_NC_0001(self):
        """
        ----------------------------------------------------------------------
        Title:
        ----------------------------------------------------------------------
        WYMesh get_mesh_vt_str function testing normal case 0001

        ----------------------------------------------------------------------
        Description:
        ----------------------------------------------------------------------
        Testing if the mesh object texture coordinates array export string is properly generated through "get_mesh_vt_str" function, which primitive is created with code "bpy.ops.mesh.primitive_cube_add(location=(0,0,0), rotation=(0,0,0))" generates the default Blender cube on location (0,0,0) with rotation (0,0,0) and the member variable  is intialized after function call resulting get_mesh_vt_str() == "vt 0.0000 0.0000\nvt 1.0000 0.0000\nvt 1.0000 1.0000\nvt 0.0000 1.0000\n" 
        ----------------------------------------------------------------------
        Return:
        ----------------------------------------------------------------------
        :return: Return initialized WYMesh object with member variables intialized properly
        :rtype : void
        ----------------------------------------------------------------------
        Expected result:
        ----------------------------------------------------------------------
        :expect: get_mesh_vt_str() == "vt 0.0000 0.0000\\nvt 1.0000 0.0000\\nvt 1.0000 1.0000\\nvt 0.0000 1.0000\\n"
        :expect: [Vector((0.0000, 0.0000)),Vector((1.0000, 0.0000)),Vector((1.0000, 1.0000)),Vector((0.0000, 1.0000)),Vector((0.0000, 0.0000)),Vector((1.0000, 0.0000)),Vector((1.0000, 1.0000)),Vector((0.0000, 1.0000)),Vector((0.0000, 0.0000)),Vector((1.0000, 0.0000)),Vector((1.0000, 1.0000)),Vector((0.0000, 1.0000)),Vector((0.0000, 0.0000)),Vector((1.0000, 0.0000)),Vector((1.0000, 1.0000)),Vector((0.0000, 1.0000)),Vector((0.0000, 0.0000)),Vector((1.0000, 0.0000)),Vector((1.0000, 1.0000)),Vector((0.0000, 1.0000)),Vector((0.0000, 0.0000)),Vector((1.0000, 0.0000)),Vector((1.0000, 1.0000)),Vector((0.0000, 1.0000))]
        """
        bpy.ops.mesh.primitive_cube_add(location=(0,0,0), rotation=(0,0,0))
        cube = bpy.context.object
        cube.name = "TestCube0001"
        wymesh = WYMesh(cube, WYCoordsys(False,False,False,False,True,False,False,False,True,False,False,False))
        cube.data.uv_textures.new(name="TestTexture0001")
        wymesh.init_mesh_texcoord_data()
        self.assertEqual(wymesh.main_mesh_obj.data.uv_layers[0].name, "TestTexture0001")
        self.assertTrue(wymesh.main_mesh_obj.name == "TestCube0001")
        self.assertTrue(len(wymesh.main_mesh.polygons) == 6)
        self.assertTrue(len(cube.data.uv_layers[0].data) == 24) 
        self.assertTrue(wymesh.get_mesh_vt_str() == "vt 0.0000 0.0000\nvt 1.0000 0.0000\nvt 1.0000 1.0000\nvt 0.0000 1.0000\n")
